prompt --application/shared_components/security/authentications/user_auth
begin
wwv_flow_api.create_authentication(
 p_id=>wwv_flow_api.id(11337659691016673)
,p_name=>'user_auth'
,p_scheme_type=>'NATIVE_CUSTOM'
,p_attribute_03=>'user_auth'
,p_attribute_05=>'N'
,p_plsql_code=>wwv_flow_string.join(wwv_flow_t_varchar2(
'FUNCTION user_auth(p_username IN VARCHAR, p_password IN VARCHAR) RETURN BOOLEAN AS',
'  v_hashed_password VARCHAR2(2000);',
'BEGIN',
'  -- Check if the user is a trader',
'  FOR trader_rec IN (',
'    SELECT 1',
'    FROM trader',
'    WHERE UPPER(full_name) = UPPER(p_username)',
'      AND (email = p_password)',
'  )',
'  LOOP',
'    RETURN TRUE;',
'  END LOOP;',
'',
'  -- Check if the user is an admin',
'  FOR admin_rec IN (',
'    SELECT 1',
'    FROM admin',
'    WHERE UPPER(admin_name) = UPPER(p_username)',
'      AND (admin_password = p_password OR admin_password = hash_password(p_password))',
'  )',
'  LOOP',
'    RETURN TRUE;',
'  END LOOP;',
'',
'  -- If no matching user is found, return FALSE',
'  RETURN FALSE;',
'',
'EXCEPTION',
'  WHEN OTHERS THEN',
'    RETURN FALSE;',
'END user_auth;',
''))
,p_invalid_session_type=>'LOGIN'
,p_use_secure_cookie_yn=>'N'
,p_ras_mode=>0
);
end;
