,p_plug_template=>wwv_flow_api.id(11120975511884583)
,p_plug_display_sequence=>50
,p_plug_display_point=>'BODY'
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'    ''Weekly'' AS PERIOD_TYPE,',
'    TRUNC(od.ORDER_DATE, ''IW'') AS PERIOD_START_DATE,',
'    COUNT(od.ORDER_ID) AS TOTAL_ORDERS,',
'    SUM(od.QUANTITY_ORDERED * od.PRICE) AS TOTAL_SALES',
'FROM ',
'    ORDERDETAIL od',
'JOIN ',
'    PRODUCTS p ON od.ADD_PRODUCT_ID = p.ADD_PRODUCT_ID',
'WHERE ',
'    p.TRADER_ID = (SELECT TRADER_ID FROM TRADER WHERE UPPER(full_name) = UPPER(:APP_USER))',
'    AND od.ORDER_DATE >= TRUNC(SYSDATE, ''IW'')',
'    AND od.ORDER_DATE < TRUNC(SYSDATE, ''IW'') + 7',
'GROUP BY ',
'    TRUNC(od.ORDER_DATE, ''IW'')',
'    ',
'UNION ALL',
'',
'SELECT ',
'    ''Monthly'' AS PERIOD_TYPE,',
'    TRUNC(od.ORDER_DATE, ''MM'') AS PERIOD_START_DATE,',
'    COUNT(od.ORDER_ID) AS TOTAL_ORDERS,',
'    SUM(od.QUANTITY_ORDERED * od.PRICE) AS TOTAL_SALES',
'FROM ',
'    ORDERDETAIL od',
'JOIN ',
'    PRODUCTS p ON od.ADD_PRODUCT_ID = p.ADD_PRODUCT_ID',
'WHERE ',
'    p.TRADER_ID = (SELECT TRADER_ID FROM TRADER WHERE UPPER(full_name) = UPPER(:APP_USER))',
'    AND od.ORDER_DATE >= TRUNC(SYSDATE, ''MM'')',
'    AND od.ORDER_DATE < TRUNC(ADD_MONTHS(SYSDATE, 1), ''MM'')',
'GROUP BY ',
'    TRUNC(od.ORDER_DATE, ''MM'')',
'    ',
'UNION ALL',
'',
'SELECT ',
'    ''Daily'' AS PERIOD_TYPE,',
'    TRUNC(od.ORDER_DATE) AS PERIOD_START_DATE,',
'    COUNT(od.ORDER_ID) AS TOTAL_ORDERS,',
'    SUM(od.QUANTITY_ORDERED * od.PRICE) AS TOTAL_SALES',
'FROM ',
'    ORDERDETAIL od',
'JOIN ',
'    PRODUCTS p ON od.ADD_PRODUCT_ID = p.ADD_PRODUCT_ID',
'WHERE ',
'    p.TRADER_ID = (SELECT TRADER_ID FROM TRADER WHERE UPPER(full_name) = UPPER(:APP_USER))',
'    AND od.ORDER_DATE >= TRUNC(SYSDATE)',
'GROUP BY ',
'    TRUNC(od.ORDER_DATE);',
''))
,p_plug_source_type=>'NATIVE_JET_CHART'
,p_plug_query_options=>'DERIVED_REPORT_COLUMNS'
);
