'DECLARE',
'    PROCEDURE DELETE_PRODUCT_AND_DETAILS (',
'        v_ADD_PRODUCT_ID IN PRODUCTS.ADD_PRODUCT_ID%TYPE',
'    ) IS',
'    BEGIN',
'        -- Delete from ORDERDETAIL',
'        DELETE FROM ORDERDETAIL',
'        WHERE ADD_PRODUCT_ID = v_ADD_PRODUCT_ID;',
'',
'        -- Delete from CARTPRODUCT',
'        DELETE FROM CARTPRODUCT',
'        WHERE ADD_PRODUCT_ID = v_ADD_PRODUCT_ID;',
'',
'        -- Delete from FAV_PRODUCT',
'        DELETE FROM FAV_PRODUCT',
'        WHERE ADD_PRODUCT_ID = v_ADD_PRODUCT_ID;',
'',
'        -- Delete from USERREVIEW',
'        DELETE FROM USERREVIEW',
'        WHERE ADD_PRODUCT_ID = v_ADD_PRODUCT_ID;',
'',
'        -- Finally, delete the product itself',
'        DELETE FROM PRODUCTS',
'        WHERE ADD_PRODUCT_ID = v_ADD_PRODUCT_ID;',
'',
'        -- Commit the transaction',
'        COMMIT;',
'    EXCEPTION',
'        WHEN OTHERS THEN',
'            -- Rollback in case of any error',
'            ROLLBACK;',
'            -- Raise the exception to notify the calling environment',
'            RAISE;',
'    END DELETE_PRODUCT_AND_DETAILS;',
'BEGIN',
'    NULL; -- Placeholder to satisfy the syntax requirement of DECLARE section',
'END;',
'',
''))
,p_error_display_location=>'INLINE_IN_NOTIFICATION'
);
