 p_id=>wwv_flow_api.id(11685794829296276)
,p_plug_name=>'DAILY SALES '
,p_region_template_options=>'#DEFAULT#'
,p_plug_template=>wwv_flow_api.id(11119093379884581)
,p_plug_display_sequence=>10
,p_plug_display_point=>'BODY'
,p_query_type=>'SQL'
,p_plug_source=>wwv_flow_string.join(wwv_flow_t_varchar2(
'SELECT ',
'    T.TRADER_ID,',
'    T.FULL_NAME AS TRADER_NAME,',
'    TRUNC(OD.ORDER_DATE) AS ORDER_DAY,',
'    SUM(OD.QUANTITY_ORDERED * OD.PRICE) AS DAILY_SALES',
'FROM ',
'    ORDERDETAIL OD',
'JOIN ',
'    PRODUCTS P ON OD.ADD_PRODUCT_ID = P.ADD_PRODUCT_ID',
'JOIN ',
'    TRADER T ON P.TRADER_ID = T.TRADER_ID',
'WHERE ',
'    TRUNC(OD.ORDER_DATE) = TRUNC(SYSDATE)',
'GROUP BY ',
'    T.TRADER_ID,',
'    T.FULL_NAME,',
'    TRUNC(OD.ORDER_DATE)',
'ORDER BY ',
'    T.TRADER_ID;',
''))
,p_plug_source_type=>'NATIVE_IR'
);
